import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
function RenderRow({row}) {
    <Grid>
        {row.map((item) => {
            <Grid item xs={1.33}>
                {item}
            </Grid>
        })}
    </Grid>
}
const Ticket = ({ ticket }) => {
    return (
        <Grid container spacing={3}>
            <RenderRow row={ticket[0]}/>
        </Grid>
    )
}
export default Ticket;
